  const { id } = useParams()
  const { auth } = useSelector(state => state)
  const dispatch = useDispatch()

  const [userData, setUserData] = useState([])

  useEffect(() => {
    if (id === auth.user._id){
      setUserData([auth.user])
    }
  }, [id, auth.user])

